import { Link } from "react-router-dom";

const NavBar = () => {
  return (
    <nav>
      <ul>
        {icon}
        <li>
          <Link to="/footer">Footer</Link>
        </li>
        <li>
          <button>logOut</button>
        </li>
      </ul>
    </nav>
  );
};

export default NavBar;
